import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);
  const [error, setError] = useState('');

  const handleSearch = async () => {
    if (!query) {
      alert('Please enter a search term');
      return;
    }

    try {
      const response = await axios.post('http://localhost:3001/search', { query });
      setResults(response.data);
      setError('');
    } catch (err) {
      console.error('Error fetching data:', err);
      setError('Failed to fetch results.');
    }
  };

  return (
    <div className="App">
      <header className="navbar">
        <h1>Facebook Ads Interest Search</h1>
      </header>

      <main>
        <section id="search-section">
          <input
            type="text"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            placeholder="Enter interest..."
            className="search-box"
          />
          <button onClick={handleSearch} className="search-button">Search</button>

          {error && <p className="error">{error}</p>}

          <ul className="results-list">
            {results.map((interest) => (
              <li key={interest.id} className="result-item">
                <p><strong>ID:</strong> {interest.id}</p>
                <p><strong>Name:</strong> {interest.name}</p>
                <p><strong>Audience Size:</strong> {interest.audience_size_lower_bound} - {interest.audience_size_upper_bound} </p> 
                <p><strong>Path 1:</strong> {interest.path[0]}</p>
                <p><strong>Path 2:</strong> {interest.path[1] || 'N/A'}</p>
                <p><strong>Path 3:</strong> {interest.path[2] || 'N/A'}</p>
                <p><strong>Description:</strong> {interest.description || 'N/A'}</p>
                <p><strong>Topic:</strong> {interest.topic || 'N/A'}</p>
              </li>
            ))}
          </ul>

          {results.length > 0 && (
            <table className="results-table">
              <thead>
                <tr>
                  <th>ID</th>
                  <th>Name</th>
                  <th>Audience Size</th>
                  <th>Path 1</th>
                  <th>Path 2</th>
                  <th>Path 3</th>
                  <th>Description</th>
                  <th>Topic</th>
                </tr>
              </thead>
              <tbody>
                {results.map((interest) => (
                  <tr key={interest.id}>
                    <td>{interest.id}</td>
                    <td>{interest.name}</td>
                    <td>{interest.value}</td>
                    <td>{interest.path[0]}</td>
                    <td>{interest.path[1] || 'N/A'}</td>
                    <td>{interest.path[2] || 'N/A'}</td>
                    <td>{interest.description || 'N/A'}</td>
                    <td>{interest.topic || 'N/A'}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </section>
      </main>
    </div>
  );
}

export default App;
